'''
给你一个字符串 s 和一个字符串数组 dictionary 作为字典，找出并返回字典中最长的字符串，该字符串可以通过删除 s 中的某些字符得到。

如果答案不止一个，返回长度最长且字典序最小的字符串。如果答案不存在，则返回空字符串。


示例 1：

输入：s = "abpcplea", dictionary = ["ale","apple","monkey","plea"]
输出："apple"
示例 2：

输入：s = "abpcplea", dictionary = ["a","b","c"]
输出："a"

提示：

1 <= s.length <= 1000
1 <= dictionary.length <= 1000
1 <= dictionary[i].length <= 1000
s 和 dictionary[i] 仅由小写英文字母组成
'''
from typing import List

from leetcode.tools.time import printTime


class Solution:
    '''
    字典树
    '''
    @printTime()
    def findLongestWord(self, s: str, dictionary: List[str]) -> str:
        class Trie:
            def __init__(self):
                self.dict = [None for _ in range(26)]
                self.tail = False
                self.mem = {}

            def put(self, s):
                if len(s) == 0:
                    self.tail = True
                    return
                index = ord(s[0]) - ord('a')
                if not self.dict[index]:
                    self.dict[index] = Trie()
                self.dict[index].put(s[1:])

            def search(self, s, idx):
                if s in self.mem:
                    return self.mem[s]
                ans = ''
                f = False
                for i in range(idx, len(s)):
                    c = s[i]
                    if self.dict[ord(c) - ord('a')]:
                        t1, f1 = self.dict[ord(c) - ord('a')].search(s, i + 1)
                        t = c + t1
                        if f1 and (len(t) > len(ans) or (len(t) == len(ans) and t < ans)):
                            ans = t
                            f = True
                self.mem[s] = ans, f or self.tail
                return ans, f or self.tail

        trie = Trie()
        for d in dictionary:
            trie.put(d)
        return trie.search(s, 0)[0]

    '''
    双指针
    '''
    @printTime()
    def _1findLongestWord(self, s: str, dictionary: List[str]) -> str:
        def find(s, p):
            i = 0
            j = 0
            while i < len(s):
                if s[i] == p[j]:
                    j += 1
                    if j == len(p):
                        return True
                i += 1
            return False
        dictionary.sort(key=lambda x: (-len(x), x))
        for d in dictionary:
            if find(s, d):
                return d
        return ''

